import React from 'react'
import { Button, List, Typography } from 'antd'
import ModalPage from './modalpage';

export default class Datapass extends React.Component {
  constructor(props) {
    super(props);
    console.log(this.props);
    this.state ={deps:[], addModalShow : false}
  }

  componentDidMount(){
    this.refreshList();
    console.log("componetDidMount")
  }

  refreshList(){
    /*fetch('http://140.115.54.75:5001/api/values')
    .then(response=> response.json())
    .then(data =>{
      this.setState({deps:data});
    });*/

    this.setState({
      deps:[{"departmentID":1,"departmentString":2},
      {"departmentID":1,"departmentString":2},
      {"departmentID":1,"departmentString":2},
      {"departmentID":1,"departmentString":2},
      {"departmentID":12,"departmentString":23}
    ]
    })

  //console.log(deps.map(dep=>{dep.DepartmentID}))

  }


  render() {
    let addModalClose=()=> this.setState({addModalShow : false})
    const {deps}=this.state;
    const { history } = this.props
    return (
      <div>
        {/*<p>demo - {config}</p>
        <hr />
        <h3 style={{ marginBottom: 16 }}>Default Size</h3>*/}
        <List
          //header={<div>Header</div>}
          //footer={<div>Footer</div>}
          bordered
          dataSource={deps.map(dep=>
            //<td>{dep.departmentID}</td>
	    <td>{dep.departmentString}</td>
            )}
          renderItem={item => (
            <List.Item>
              <Typography.Text mark>[ITEM]</Typography.Text> {item}
            </List.Item>
          )}
        />
        <Button onClick={() => {
          history.goBack()
        }}>back</Button>
        <Button onClick={() => this.setState({addModalShow : true})}>
          POST
        </Button>
        <ModalPage
        show={this.setState.addModalShow}
        onHide={addModalClose}
        />
      </div>
    )
  }

} // class Page end
